CREATE TABLE `destinatarios` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `documento_resolucion` int(11) NOT NULL,
  `departamento` int(11) DEFAULT NULL,
  `responsable` int(11) DEFAULT NULL,
  `usuario_alta` int(11) DEFAULT NULL,
  `usuario_ultimo_estado` int(11) DEFAULT NULL,
  `fecha_hora_alta` datetime DEFAULT NULL,
  `fecha_hora_ultimo_estado` datetime DEFAULT NULL,
  `empresa` int(11) DEFAULT NULL,
  `tipo_envio` char(2) DEFAULT NULL,
  `estado` char(2) DEFAULT NULL,
  `tipo_documento` char(2) DEFAULT NULL,
  `responsable_anterior` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_documento_fk1_idx` (`departamento`),
  KEY `fk_documento_fk2_idx` (`responsable`),
  KEY `fk_documento_fk3_idx` (`usuario_alta`),
  KEY `fk_documento_fk4_idx` (`usuario_ultimo_estado`),
  KEY `fk_documento_fk5_idx` (`empresa`),
  KEY `fk_documento_fk6_idx` (`tipo_envio`),
  KEY `fk_documento_fk7_idx` (`estado`),
  KEY `fk_documento_fk8_idx` (`tipo_documento`),
  KEY `fk_documento_fk9_idx` (`responsable_anterior`),
  CONSTRAINT `fk_documento_fk1` FOREIGN KEY (`departamento`) REFERENCES `departamentos` (`id`),
  CONSTRAINT `fk_documento_fk2` FOREIGN KEY (`responsable`) REFERENCES `usuarios` (`id`),
  CONSTRAINT `fk_documento_fk3` FOREIGN KEY (`usuario_alta`) REFERENCES `usuarios` (`id`),
  CONSTRAINT `fk_documento_fk4` FOREIGN KEY (`usuario_ultimo_estado`) REFERENCES `usuarios` (`id`),
  CONSTRAINT `fk_documento_fk5` FOREIGN KEY (`empresa`) REFERENCES `empresas` (`id`),
  CONSTRAINT `fk_documento_fk6` FOREIGN KEY (`tipo_envio`) REFERENCES `tipos_envio` (`codigo`),
  CONSTRAINT `fk_documento_fk7` FOREIGN KEY (`estado`) REFERENCES `estados_documento` (`codigo`),
  CONSTRAINT `fk_documento_fk8` FOREIGN KEY (`tipo_documento`) REFERENCES `tipos_documentos_judiciales` (`codigo`),
  CONSTRAINT `fk_documento_fk9` FOREIGN KEY (`responsable_anterior`) REFERENCES `usuarios` (`id`)
